import "../dots.css";
function Dots()
{
    return (
        <div className="dots">
        <span class="dot1"></span>
         <div class="space"></div>
        <span class="dot2"></span>
          <div class="space"></div>
        <span class="dot2"></span>
        </div>
    );
}
export default Dots;
